window.bookSummaryJSON = "<p>An exciting novelette set in Jeaniene Frost’s Night Huntress world.</p> <p>A romantic getaway for vampires Cat Crawfield and her husband Bones is cut short when they’re called on to guard a spoiled heiress with a price on her head, and an undead hitman on her trail.</p> <p>What starts as a simple bodyguard job ends up being a fight for survival that neither Cat, nor Bones, saw coming.</p> <p>Performed by Yasmin Tuazon, Danny Gavigan, Carolyn Kashner, Holly Adams, Shawn K. Jain, Christopher Graybill, Bradley Foster Smith, Chris Stinson, Matthew Bassett, Rayner Gabriel, Rose Elizabeth Supan, Ryan Carlo Dalusung, and Terence Aselford.</p>"; 
